    componentDidMount(){
        console.log(this.props)
    }
    render(){
        return(
            <div>
              <h1>{this.props.value}</h1>
              <button onClick={this.props.onIncrement}>加1</button><br/>
              <button onClick={this.props.onDecrement}>减1</button><br/>
            </div>
        )
    }
}
